import React, { useEffect, useState } from 'react';
import Cards from './Cards';

const Search = () =>{
const [breed ,setBreed] = useState("");
const [dogs,setDogs] = useState("");
const [msg,setMsg] = useState()
const [updated,setUpdated] = useState(msg)
const api_key = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpYXQiOjE2NzgzMDU2MTF9.Ky49nXH6qgHJQ0CBsZGYsP7_Is2am3u5j3RAdEl457s';

    useEffect(()=>{
        const fetchBreed = async ()=>{
            try{
                const response = await axios.get(
                    'https://frontend-take-home-service.fetch.com/dogs/breeds',
                    {withCredentials:true, headers: {'fetch-api-key':'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpYXQiOjE2NzgzMDU2MTF9.Ky49nXH6qgHJQ0CBsZGYsP7_Is2am3u5j3RAdEl457s'}
                })
            setBreed(response.data);
            // console.log(breed)
    }
    catch(error){
        console.log(error);
        }
        }
        fetchBreed();
    },[])

    const handleChange =(e)=>
    {
        setMsg(e.target.value)    
    }
    const handleClick=(event)=>{
        event.preventDefault()
        setUpdated(msg)    
    }

// console.log(msg)

    return (
        <div>
        <form className="search-bar">
        <input type="text"   onChange = {handleChange} value = {msg}/>
            <input type ="submit" onClick={handleClick} />
        </form>    
        <div>
        <Cards breed={updated}/>
        </div>
       </div>          
  );
}

export default Search;
